import { makeStyles } from '@material-ui/core/styles';

const DrawerStyle = makeStyles((theme) => ({
    body: {
        backgroundColor: '#F5F5F5',
        height: 'inherit'
    },
    head: {
        alignItems: 'center',
        backgroundColor: '#FFFFFF',
        display: 'flex',
        flexDirection: 'row',
        height: 100
    },
    
    grayIcon: {
        color: '#666666',
        marginLeft: theme.spacing(3)
    },
    darkGrayText: {
        color: '#333333',
        fontFamily: 'Audiowide',
        fontWeight: '400',
        marginLeft: theme.spacing(3)
    },
}));

export default DrawerStyle;
